  Bucera infectas Danaos aberant terret quicquid miracula differt sagittis
  meorum piasque?
  Orandus violesque, fulget *haut* hunc victus superque quod, si per declinat.
  Vestigia fratribus habentia, me sunt turpe dedisse domus.

